    return (
        <div id="shopping-cart">
            <div className="name_cart">Mi carrito</div>
            {
                cart.length === 0 ? <div className="text-center">El carrito está vacío</div> : cart.map( e => console.log(e) )                
            }
        </div>
    )
}

export default Cart;
